import React from "react";
import styles from "./NavBarItem.module.css";

const NavBarItem = (props) => {
  const data = [
    {
      type: "Stays",
      icon: "fa-bed",
      active: true,
    },
    {
      type: "Flights",
      icon: "fa-plane",
      active: false,
    },
    {
      type: "Car rentals",
      icon: "fa-car",
      active: false,
    },
    {
      type: "Attractions",
      icon: "fa-bed",
      active: false,
    },
    {
      type: "Airport taxis",
      icon: "fa-taxi",
      active: false,
    },
  ];

  const item = data.map((item) => {
    return (
      <li className={item.active === true ? `${styles.border}` : ""}>
        <i className={`fa ${item.icon}``${styles.i}`}></i>
        {item.type}
      </li>
    );
  });
  return item;
};

export default NavBarItem;
